 <div class="col-xs-12 mocktest-faqs">
<div class="wrapper">
<div class="row">
<div class="col-xs-12">
<div class="header">
<h5 class="title">Frequently Asked Questions</h5>
</div>
<div class="body faqs-section">
<div class="faq-questions">
<div class="row">
<div class="col-xs-12 col-sm-6">
<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>What is Bank PO Exam?</h4>
<div class="answer"> <p>The full form of Bank PO Exam is ‘Bank Probationary Officer Exam’. Bank PO is a Managerial Level post offered in various banks of the country. This exam is conducted by various recruiting bodies to recruit Bank PO every year. These recruiting bodies are IBPS, SBI, IPPB etc.</p>
<p>Institute of Banking Personnel Selection or IBPS organises PO exam to select candidates for this post in 20 Public Sector Banks in India. These banks are Allahabad Bank, Andhra Bank, Bank of Baroda, Bank of India, Bank of Maharashtra, Canara Bank, Central Bank of India, Corporation Bank, Dena Bank, IDBI Bank, Indian Bank, Indian Overseas Bank, Oriental Bank of Commerce, Punjab National Bank, Punjab &amp; Sind Bank, Syndicate Bank, UCO Bank, Union Bank of India, United Bank of India and Vijaya Bank.</p>
<p>Apart from IBPS, other private banks &amp; public sector banks like SBI &amp; IPPB hold their respective exams to recruit Probationary Officer.</p></div>
</div>
<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>How much can I earn as a Bank PO?</h4>
<div class="answer"> A Bank PO salary is hefty right from the initial stage. The Pay Scale is different that depends on the bank you are working in. Let’s have a look on the difference of Pay Scale for IBPS &amp; SBI bank which you can earn if you get recruited.
<ul>
<li>If you get recruited in any of the Banks under IBPS, the Final Bank PO Salary including HRA, DA, etc. goes up to Rs. 38,360 – 40,700/- initially. Moreover, it will increase along your career path at the bank. Apart from that, there are a number of allowances that you will be getting like medical cover, travel allowance, Newspaper allowance etc.</li>
<li>If you are recruited as a SBI PO, the Pay Scale is 23700-980/7-30560-1145/2-32850-1310/7-42020. The Total compensation per annum is a minimum of ₹7.55 lakhs and maximum of ₹12.93 lakhs depending on place of posting and other factors. This means that an entry level SBI Probationary Officer in a city like Mumbai could earn over ₹1 lakh a month.</li>
</ul></div>
</div>
<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>Why should I enroll for the Bank PO Online Test Series?</h4>
<div class="answer">
<ol>
<li>Feel the real exam through our tests
<ul>
<li>Includes everything that you are expected to face in Bank PO</li>
<li>Exact Bank PO preliminary exam pattern questions, the best of Testbook - designed by highly experienced experts</li>
<li>Leave no surprises for the test day - get yourself acquainted with Exam interface on our tests</li>
</ul>
</li>
<li>Review your performance on tests and learn
<ul>
<li>Gauge where you stand with our rank estimate</li>
<li>Get scientific and detailed analysis of your performance - thanks to our expert data scientists. We track everything you can imagine!</li>
<li> Get access to detailed solutions and explanations written by experts</li>
</ul>
</li>
</ol></div>
</div>
<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>What is the Bank PO Syllabus for various Exam?</h4>
