<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>What does a person selected as a Bank PO do?</h4>
<div class="answer"> A Probationary Officer holds the designation of an Assistant Manager in any Public Sector Bank. A Bank PO has various functions to play in the working of a bank which are stated below:
<ul>
<li><b><u>Banking Activities Regulation</u></b>– A Bank PO has the duty of managing all the functions of thel bank and seeing that all the activities are performed on time and as planned.</li>
<li><b><u>Loans &amp; Credit Facility</u></b>- He has the responsibility of the promotion of Loans and Credit facility of the Rural Bank amongst farmers for Agricultural Development &amp; distribute the credits. He has to Make the farmers understand the benefits of the credit facilities in the most transparent ways.</li>
<li><b><u>Credit profile</u></b>– Checking upon the loan taker and further check his capacity to pay back the loan to avoid the loans to turn in Non Performing Assets is one of the most important responsibilities of a Bank PO.</li>
<li><b><u>Repay of the loan</u></b>He has the responsibility of maintaining the official records of the loans taken by different entities, reminding them to repay them and taking the other alternative actions like mortgaging the properties if the need be.</li>
<li><b><u>Public Communication</u></b>Communicating to the masses and spreading the different policies and schemes to local people is the key duty of the Bank PO. </li>
<li><b><u>Audit of the report</u></b>He is responsible for maintaining the bank’s annual balance sheet and access the annual reports of the bank &amp; creating the audit reports of the financial year and tallying it with the last year’s report to check profit.</li>
 <li><b><u>The implementation of schemes</u></b>Implementing the schemes passed by Central Government for the development of Rural Area &amp; managing distribution of the money among them that is allotted by Government is the responsibility of the Bank PO.</li>
</ul></div>
</div>
<div class="faq-box">
<h4 class="question"><i class="tb-icon tb-arrow-down"></i>Am I eligible for Bank PO exams?</h4>
<div class="answer"> Overall, there are 2 criteria on which the eligibility of a candidate is judged for Bank PO - education and age. You need to qualify following Bank PO eligibility standards to apply for the Bank PO exam.
<ol>
<li>
<b><u>Age Limit for Bank PO Exam</u></b><br><p>Minimum Age - 21 years</p><p>Maximum Age - 30 years</p><p>You need to fall under this upper &amp; lower age limit to apply for Bank PO.</p>
<b><u>Age Relaxation for Bank PO Exam</u></b><br>The Age Relaxation for Bank PO Exam will be applicable as per Govt. norms. The Bank PO 2017 Age Relaxation for different categories are as follows:
<ul>
<li>SC/ST - 5 years</li>
<li>OBC (Non - Creamy Layer) - 3 years</li>
<li>PWD(SC/ST) - 15 years</li>
<li>PWD(OBC) - 13 years</li>
<li>PWD(Gen) - 10 years</li>
<li>Ex-Servicemen, Commissioned Officers with 5 years’ service completed &amp; released - 5 years</li>
<li>Jammu &amp; Kashmir domiciled during 01.01.1980 to 31.12.1989 - 5 years</li>
</ul>
</li>
<li><b><u>Bank PO Educational Qualification</u></b><br>The minimum qualification required to apply for Bank PO Recruitment is a Bachelor’s Degree.</li>
</ol></div>
</div>
