<h4 class="question"><i class="tb-icon tb-arrow-down"></i>What is the Bank PO Exam Pattern &amp; Selection Procedure?</h4>
<div class="answer"> The selection process for the Bank PO exam consists of 3 stages, which are:
<ol>
<li>Prelims Exam</li>
<li>Mains Exam (Objective + Descriptive)</li>
<li>Interview</li>
</ol>
<ul>
<li>There is one-fourth negative marking in both Prelims &amp; Mains for each question wrongly marked!</li>
<li>Once you clear the first 2 stages of IBPS PO Exam, you will have to face an Interview.</li>
<li>Once you clear all these 3 stages, you will be selected as a Bank PO.</li>
</ul>
<p>The Bank PO Exam is conducted in 3 stages out of which the first 2 stages are online written exams and the 3rd stage takes place with the Interview of candidates who are selected in the previous stages.</p>
